  summary: >-
    Represents a generic interface for a Pelias API response with specified generic types,

    extending the general entity interface.
  example: []
  syntax:
    content: 'public interface IResponse<TGeocoding, TFeature, TProperties, TGeometry, TBoundingBox, TCoordinates, TAngle> : IEntity where TGeocoding : IGeocoding where TFeature : IFeature<TProperties, TGeometry, TBoundingBox, TCoordinates, TAngle> where TProperties : IProperties where TGeometry : IGeometry<TBoundingBox, TCoordinates, TAngle> where TBoundingBox : IBoundingBox<TCoordinates, TAngle> where TCoordinates : ICoordinates<TAngle> where TAngle : IAngle'
    typeParameters:
    - id: TGeocoding
      description: The type representing geocoding information in the response.
    - id: TFeature
      description: The type representing a feature in the response.
    - id: TProperties
      description: The type representing properties of a feature.
    - id: TGeometry
      description: The type representing the geometry of a feature.
    - id: TBoundingBox
      description: The type representing the bounding box of a feature.
    - id: TCoordinates
      description: The type representing the coordinates of a feature.
    - id: TAngle
      description: The type representing an angle measurement.
